// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
contract Airdrop{
    address private admin;
    mapping(address => bool) public processedAirdrops;
    IERC20 private token;
    uint256 transactionCounts;
    struct TransferStruct {
        uint256 id;
        address sender;
        address receiver;
        uint256 amount;
        string remark;
        uint256 number;
    }
    struct LimitWithDraw {
        uint256 id;
        uint256 max;
        uint256 state;
        uint256[] amount;
    }
    mapping (uint256 => TransferStruct) public transactions;
    LimitWithDraw[] limitWithDraw;
    uint256[] userManageId;
    uint256[] transactionId;
    event Processed(address recipient, uint256 amount, uint256 date);
    constructor(address _token, address _admin) {
        admin = _admin;
        token = IERC20(_token);
    }

    function updateAdmin(address newAdmin) external {
        require(msg.sender == admin, "only admin");
        admin = newAdmin;
    }

    function withdraw(
        uint256 id,
        address recipient,
        uint256 amount,
        uint256 max,
        uint256 state,
        bytes calldata signature
    ) external {
        bytes32 message = prefixed(
            keccak256(abi.encodePacked(recipient, amount))
        );
        require(recoverSigner(message, signature) == admin, "wrong signature");
        if (userManageId.length == 0) {
            userManageId.push(id);
            uint256[] memory data = new uint256[](1);
            data[0] = amount;
            limitWithDraw.push(LimitWithDraw(id, max, state, data));
        } else {
            uint256 index;
            bool isFound = true;
            for (uint256 i = 0; i < userManageId.length; i++)
                if (userManageId[i] == id) {
                    index = i;
                } else {
                    isFound = false;
                }
            if (isFound == false) {
                userManageId.push(id);
                uint256[] memory data = new uint256[](1);
                data[0] = amount;
                limitWithDraw.push(LimitWithDraw(id, max, state, data));
            } else {
                if (state == limitWithDraw[index].state) {
                    bool isMoreThan = false;
                    uint256 all = 0;
                    uint256 i = 0;
                    uint256 len = limitWithDraw[index].amount.length;
                    for (i = 0; i < len; i++) {
                        all = all + limitWithDraw[index].amount[i];
                    }
                    if ((all + amount) > max) {
                        isMoreThan = true;
                    } else {
                        limitWithDraw[index].amount.push(amount);
                    }
                    require(isMoreThan == false, "withdraw more than maximum");
                } else {
                    limitWithDraw[index].amount = [amount];
                    limitWithDraw[index].state = state;
                    limitWithDraw[index].max = max;
                }
            }
        }

        token.transfer(recipient, amount);
        transactionCounts += 1;
        transactions[id].id = id;
        transactions[id].sender = admin;
        transactions[id].receiver = recipient;
        transactions[id].amount = amount;
        transactions[id].remark = "withdraw";
        transactions[id].number = block.number;
        transactionId.push(id);
        emit Processed(recipient, amount, block.timestamp);
    }

    function deposit(
        uint256 id,
        address owner,
        address recipient,
        uint256 amount
    ) external {
        token.transferFrom(owner, recipient, amount);
        transactionCounts += 1;
        transactions[id].id = id;
        transactions[id].sender = owner;
        transactions[id].receiver = recipient;
        transactions[id].amount = amount;
        transactions[id].remark = "deposit";
        transactions[id].number = block.number;
        transactionId.push(id);
        emit Processed(recipient, amount, block.timestamp);
    }

    function prefixed(bytes32 hash) internal pure returns (bytes32) {
        return
            keccak256(
                abi.encodePacked("\x19Ethereum Signed Message:\n32", hash)
            );
    }

    function recoverSigner(bytes32 message, bytes memory sig)
        internal
        pure
        returns (address)
    {
        uint8 v;
        bytes32 r;
        bytes32 s;

        (v, r, s) = splitSignature(sig);

        return ecrecover(message, v, r, s);
    }

    function splitSignature(bytes memory sig)
        internal
        pure
        returns (
            uint8,
            bytes32,
            bytes32
        )
    {
        require(sig.length == 65);

        bytes32 r;
        bytes32 s;
        uint8 v;

        assembly {
            // first 32 bytes, after the length prefix
            r := mload(add(sig, 32))
            // second 32 bytes
            s := mload(add(sig, 64))
            // final byte (first byte of the next 32 bytes)
            v := byte(0, mload(add(sig, 96)))
        }

        return (v, r, s);
    }

    function checkAddress() public view returns (address) {
        return msg.sender;
    }

    function getTransactionIdAll() public view returns (uint256[] memory) {
        return transactionId;
    }

    function getTransactions(uint256 id) public view returns (TransferStruct memory) {
        return transactions[id];
    }

    function getTransactionsCount() public view returns (uint256) {
        return transactionCounts;
    }

    function getLimitWithDraw() public view returns (LimitWithDraw[] memory) {
        return limitWithDraw;
    }
}
